
const PUPPETEER = require('puppeteer');

const URL_LOGIN = 'http://192.168.10.58/login/index.php';
const URL_CREATE_NEW_USERS = 'http://192.168.10.58/user/editadvanced.php?id=-1';

let BROWSER, PAGE;

async function ___login(callback) {
    BROWSER = await PUPPETEER.launch({ args: ['--no-sandbox', '--disable-setuid-sandbox'] });
    PAGE = await BROWSER.newPage();
    PAGE.on('console', msg => { console.log(msg.text()); });

    //[1] go page login
    await PAGE.goto(URL_LOGIN, { waitUntil: 'domcontentloaded' });
    await PAGE.setViewport({ width: 1024, height: 800 });
    //await PAGE.screenshot({ fullPage: true, path: FILE_NAME_SCREENSHOT });
    //console.log('Screenshot done ...');

    //[2] submit login
    await PAGE.evaluate(() => {
        let e_username = document.querySelector('input[name=username]');
        let e_password = document.querySelector('input[name=password]');
        let e_submit = document.querySelector('button[id=loginbtn]');
        if (e_username && e_password && e_submit) {
            e_username.setAttribute('value', 'admin');
            e_password.setAttribute('value', '12345@F88.vn');

            e_submit.click();
        }
    });

    await PAGE.screenshot({ fullPage: true, path: '1.login.png' });
    console.log('> [1] LOGIN FINISH ...');

    if (callback) {
        //setTimeout(function () {
        callback();
        //}, 100);
    }
};

