async function ___create_user(user) {

    //[2] go page create new users
    await PAGE.goto(URL_CREATE_NEW_USERS, { waitUntil: 'domcontentloaded' });
    //await PAGE.screenshot({ fullPage: true, path: '2.create-new-user.png' });


    await PAGE.evaluate((user) => {
        if (user) {

            let username = user.str_user_name;
            let password = '12345@Aa';
            let email = username + '@f88.vn';
            let fullname = user.str_full_name;
            //fullname = username;
            //console.log('-> ' + i + ' = ' + username);
            console.log('\r\n[2] -> username = ' + username);

            let e = document.querySelector('input[id="id_username"]');
            if (e) e.setAttribute('value', username);
            else console.log('[2] ERROR: Cannot found field username');

            e = document.querySelector('input[id="id_firstname"]');
            if (e) e.setAttribute('value', 'F88');
            else console.log('[2] ERROR: Cannot found field id_firstname');

            e = document.querySelector('input[id="id_lastname"]');
            if (e) e.setAttribute('value', fullname);
            else console.log('[2] ERROR: Cannot found field id_lastname');

            e = document.querySelector('input[id="id_email"]');
            if (e) e.setAttribute('value', email);
            else console.log('[2] ERROR: Cannot found field email');

            e = document.querySelector('input[id="id_newpassword"]');
            if (e) e.setAttribute('value', password);
            else console.log('[2] ERROR: Cannot found field id_newpassword');

            e = document.querySelector('input[id="id_submitbutton"]');
            if (e) e.click();
            else console.log('[2] ERROR: Cannot found field id_submitbutton');

            //console.log('> [2] CREATE USER[' + username + '] SUCCESS ...');
        }

    }, user);

    //await PAGE.screenshot({ fullPage: true, path: '2.create-new-user.png' });
    await PAGE.goto(URL_CREATE_NEW_USERS, { waitUntil: 'domcontentloaded' });

    if (USERS.length > 0) {
        let u = USERS.shift();
        await ___create_user(u);
    } else
        console.log('> [3] CREATE ALL USER SUCCESS !!!!!!!!!!!!!!!! ...');
};

___login(async () => {

    if (USERS.length > 0) {
        let u = USERS.shift();
        await ___create_user(u);
    }

    await BROWSER.close();
    console.log('> BROWSER CLOSE ...');
});


